    <link rel="stylesheet" href="./index.css" />
    <style>
      body {
        background-color: rgb(35, 33, 33);
        overflow: hidden;
      }

      .SCENERY {
        width: 100vw;
        height: 100vh;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      .CONTAINER {
        position: relative;
        height: 100vh;
        width: 100vw;
        animation: air 0.5s ease-in-out infinite backwards;
        background-image: linear-gradient(
            90deg,
            rgba(0, 116, 255, 0.5),
            rgba(1, 0, 255, 0.5)
          ),
          repeating-linear-gradient(
            90deg,
            rgba(187, 187, 253, 0.5) 0px 5px,
            rgba(255, 255, 255, 0.5) 5px 10px
          );

        transform: perspective(30vh) rotateX(45deg);
        transform-style: preserve-3d;
        border: 50vh double rgba(94, 61, 202, 0.715);
        background-clip: content-box;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      @keyframes air {
        to {
          background-image: linear-gradient(
              90deg,
              rgba(1, 0, 255, 0.5),
              rgba(0, 116, 255, 0.5)
            ),
            repeating-linear-gradient(
              90deg,
              rgba(255, 255, 255, 0.5) 0px 5px,
              rgba(187, 187, 253, 0.5) 5px 10px
            );
        }
      }
      @keyframes shift {
        to {
          transform: perspective(10vh) rotateX(45deg);
        }
      }

      .__cont {
        height: 70vh;
        width: 70vh;
        background-color: rgba(255, 192, 203, 0.421);
        border-radius: 50%;

        transform: rotateX(-45deg) translateY(-7vh);
        color: rgb(255, 179, 0);
        font-size: 6vh;
        text-align: center;
        display: inherit;
        justify-content: inherit;
        align-items: inherit;
        outline: 0.8vh double rgba(229, 181, 255, 0.861);
        outline-offset: 0.5vh;
        user-select: none;
      }

      .info{
        user-select: none;
      }

    </style>
  </head>
